@Override
protected AcceptStatus accept(BytesRef term) {
  if ((includeLower
       ? collator.compare(term.utf8ToString(), lowerTermText) >= 0
       : collator.compare(term.utf8ToString(), lowerTermText) > 0)
      && (upperTermText == null
          || (includeUpper
              ? collator.compare(term.utf8ToString(), upperTermText) <= 0
              : collator.compare(term.utf8ToString(), upperTermText) < 0))) {
    return AcceptStatus.YES;
  }
  return AcceptStatus.NO;
}

